            "bisqEasy.tradeGuide.rules.content" to "- Voor die uitruil van rekeningbesonderhede tussen die verkoper en die koper, kan enige party die handel kanselleer sonder om 'n regverdigings te verskaf.\n- Handelaars moet gereeld hul transaksies nagaan vir nuwe boodskappe en moet binne 24 uur antwoordgee.\n- Sodra rekeningbesonderhede uitgewissel is, word dit beskou as 'n oortreding van die handelsooreenkoms indien handelverpligtinge nie nagekom word nie, en dit kan lei tot 'n verbod van die Bisq-netwerk. Dit geld nie as die handelvennoot nie reageer nie.\n- Tydens die Fiat-betaling MAG die koper nie terme soos 'Bisq' of 'Bitcoin' in die 'rede vir betaling' veld insluit nie. In plaas daarvan, moet die handel-ID as rede gebruik word om die bankoorplasing met die handel te assosieer.\n- As die handel nie onmiddellik voltooi kan word weens langer Fiat-oordragtye nie, moet albei handelaars ten minste een keer per dag aanlyn wees om die handel se vordering te monitor.\n- In die geval dat handelaars onopgeloste probleme ondervind, het hulle die opsie om 'n bemiddelaar in die handel geselskap te nooi vir hulp.\n\nAs jy enige vrae het of hulp nodig het, moenie huiwer om die geselskapkamers te besoek wat onder die 'Ondersteuning' menu toeganklik is nie. Gelukkige handel!",
