            "bisqEasy.tradeCompleted.info" to "Ons hoop jou ervaring was glad en aangenaam. Ons sal graag jou gedagtes wil hoor!\nOm jou indrukke in die besprekingsgesels te deel help die Bisq-span om Bisq Easy te verbeter.",
            "bisqEasy.tradeState.info.buyer.phase2a.accountDataBanned.popup.warning" to "Die verkoper se rekeningdata is verbied weens bedrogagtige aktiwiteite.\n\nStuur asseblief geen geld na hierdie rekening nie!\n\nDie peer is aan die Moderator gerapporteer en sal binnekort van die netwerk verbied word.\n\nVir jou beskerming is hierdie handel as gekanselleer gemerk. Jy kan nou veilig die handel sluit.\n\nAs jy enige vrae het of verdere hulp benodig, besoek asseblief die ondersteuningsgesels.",
