            "bisqEasy.takeOffer.review.takeOfferSuccess.subTitle" to "Neem asseblief kontak op met die handel peer by 'My oop transaksies'.\nJy sal verdere inligting vir die volgende stappe daar vind.\n\nMaak seker om gereeld die Bisq-toepassing na te gaan vir nuwe boodskappe van jou handel peer.",
