            "bisqEasy.tradeState.info.buyer.phase2a.paymentReason" to "Rede vir betaling",
            "bisqEasy.walletGuide.createWallet.content" to "Bluewallet laat jou toe om verskeie beursies vir verskillende doeleindes te skep. Vir nou hoef jy net een beursie te hê. Sodra jy Bluewallet binnegaan, sal jy 'n boodskap sien wat voorstel dat jy 'n nuwe beursie byvoeg. Sodra jy dit doen, voer 'n naam vir jou beursie in en kies die opsie *Bitcoin* onder die *Tipe* afdeling. Jy kan al die ander opsies soos hulle verskyn laat en op *Skep* klik.\n\nWanneer jy na die volgende stap beweeg, sal jy 12 woorde voorgelê word. Hierdie 12 woorde is die rugsteun wat jou toelaat om jou beursie te herstel as iets met jou foon gebeur. Skryf dit neer op 'n stuk papier (nie digitaal nie) in dieselfde volgorde waarin dit voorgelê word, stoor hierdie papier veilig en maak seker dat net jy toegang daartoe het. Jy kan meer lees oor hoe om jou beursie te beveilig in die Leer-afdelings van Bisq 2 wat aan beursies en sekuriteit gewy is.\n\nSodra jy klaar is, klik op 'Ok, ek het dit neergeskryf'.\nGeluk! Jy het jou beursie geskep! Kom ons beweeg aan na hoe om jou Bitcoin daarin te ontvang.",
            "bisqEasy.tradeCompleted.body.tradeFee.value" to "Geen handelsfooie in Bisq Easy",
            "bisqEasy.walletGuide.download.content" to "Daar is baie beursies daar buite wat jy kan gebruik. In hierdie gids sal ons jou wys hoe om Bluewallet te gebruik. Bluewallet is wonderlik en terselfdertyd baie eenvoudig, en jy kan dit gebruik om jou Bitcoin van Bisq Easy te ontvang.\n\nJy kan Bluewallet op jou foon aflaai, ongeag of jy 'n Android of iOS toestel het. Om dit te doen, kan jy die amptelike webblad by 'bluewallet.io' besoek. Sodra jy daar is, klik op App Store of Google Play, afhangende van die toestel wat jy gebruik.\n\nBelangrike nota: vir jou veiligheid, maak seker dat jy die app van die amptelike app store van jou toestel aflaai. Die amptelike app word verskaf deur 'Bluewallet Services, S.R.L.', en jy behoort dit in jou app store te kan sien. Om 'n kwaadwillige beursie af te laai kan jou fondse in gevaar stel.\n\nLaastens, 'n vinnige nota: Bisq is op geen manier met Bluewallet geaffilieer nie. Ons stel voor om Bluewallet te gebruik weens sy kwaliteit en eenvoud, maar daar is baie ander opsies op die mark. Jy behoort heeltemal vry te voel om te vergelyk, te probeer en te kies watter beursie die beste by jou behoeftes pas.",
